import React from 'react';


const OutputList = ({ prediction, title, handlePrediction }) => {
    return (
      <div className="prediction-steps">
        <h2>{ title }</h2>
        <input type="text" name="Langitude" placeholder="Langitude" required></input>
        <br></br>
        <input type="text" name="Longitude" placeholder="Longitude" required></input>
        <br></br>
        <button type="submit" onclick="runMLModel()">RUN MODEL</button>
        <button onClick={() => handlePrediction()}>predict</button>
        {prediction.map(prediction => (
          <div className="prediction-preview" key={prediction.id} >
            <h2>{ prediction.title }</h2>
          </div>
        ))}
      </div>
    );
  }

  export default OutputList;
